%[text] ![](text:image:29d5)
%[text] ## find fourier series
syms n x pi;
a0 = 1/pi * (int(-2,-pi,0)+int(2,0,pi)) %[output:71e46994]
a1 = 1/pi * int(-2 * cos(n * x), -pi, 0);
a2 = 1/pi * int( 2 * cos(n * x), 0, pi);
an = a1+a2 %[output:2fd823fe]
b1 = 1/pi * int(-2 * sin(n * x), -pi, 0);
b2 = 1/pi * int( 2 * sin(n * x), 0, pi);
bn = b1+b2;
bn = simplify(bn) %[output:0f0fc697]
%[text] ## plot f
clear
x=linspace(-pi,3*pi,300);
y5=0;
y10=0;
y20=0;

for n = 1:5
    y5 = y5 +4*(1-cos(n*pi))/(n*pi)*sin(n*x);
end
for n = 1:10
    y10 = y10 +4*(1-cos(n*pi))/(n*pi)*sin(n*x);
end
for n = 1:20
    y20 = y20 +4*(1-cos(n*pi))/(n*pi)*sin(n*x);
end
figure; %[output:71eeb02f]
hold on; grid on; %[output:71eeb02f]
axis([-pi 3*pi -3 3]); %[output:71eeb02f]

plot(x,y5, 'r-', displayname='n=5'); %[output:71eeb02f]
plot(x,y10, 'b-',displayname='n=10'); %[output:71eeb02f]
plot(x,y20,'k-', displayname='n=20'); %[output:71eeb02f]
% annotation("textarrow", [0.6732 0.5429], [0.3848 0.727], "String", "hawing")
legend() %[output:71eeb02f]
%%
%[text] ## fourier transformation
%[text] ![](text:image:0aca)
clear; 
syms x;
w=linspace(-10,10,200);
fw = int(exp(-x)*exp(-1i*w*x), 0, inf);

mag_f = 1./sqrt(1+w.^2);

figure %[output:88242fd3]
plot(w, mag_f) %[output:88242fd3]
ylabel("|F(w)|") %[output:88242fd3]



